import Box from "@mui/material/Box";
import Grid from "@mui/material/Grid";
import TextField from "@mui/material/TextField";
import Autocomplete from "@mui/material/Autocomplete";
import { useState, useEffect } from "react";
import FormControl from "@mui/material/FormControl";
import InputLabel from "@mui/material/InputLabel";
import Input from "@mui/material/Input";
import InputAdornment from "@mui/material/InputAdornment";
import TextareaAutosize from "@mui/material/TextareaAutosize";
import Button from "@mui/material/Button";
import { margin } from "@mui/system";

const AddProduct = () => {
  const [brands, setBrand] = useState([]);
  const [brandId, setBrandId] = useState();
  const [products, setProducts] = useState()
  setProducts(() => ({
    name: "",
    brand: "",
    purchase_price: 0,
    price: 0,
    status: 1,
    description: ""
  }))
  const brand = [
    {
      id: 1,
      brand: "Adidas",
    },
    {
      id: 2,
      brand: "Nike",
    },
  ];
  useEffect(() => {
    setBrand(brand);
  }, []);
  return (
    <div>
      <h2 className="page-header">Add Product</h2>
      <div className="row">
        <div className="col-12">
          <div className="card">
            <div className="card__body">
              <Box sx={{ flexGrow: 1 }}>
                <Grid container spacing={2}>
                  <Grid item xs={6}>
                    <TextField
                      onChange={prev => console.log(setProducts({...prev}))}
                      style={{ width: "100%" }}
                      sx={{ input: { color: "black", background: "#fff" } }}
                      id="filled-basic"
                      label="Product Name"
                      variant="outlined"
                    />
                  </Grid>
                  <Grid item xs={6}>
                    <Autocomplete
                      onChange={(event, newValue) => {
                        setBrandId(newValue === null ? 0 : newValue.id);
                      }}
                      // inputValue={inputValue}
                      // onInputChange={(event, newInputValue) => {
                      //   setInputValue(newInputValue);
                      // }}
                      id="controllable-states-demo"
                      getOptionLabel={(brands) =>
                        `${brands.brand} ${brands.id}`
                      }
                      options={brand}
                      sx={{ width: "100%", background: "#fff" }}
                      isOptionEqualToValue={(option, value) =>
                        option.brand === value.brand
                      }
                      noOptionsText={"NO BRAND"}
                      renderOption={(props, brands) => (
                        <Box component="li" {...props} key={brands.id}>
                          {brands.brand} {brands.id}
                        </Box>
                      )}
                      renderInput={(params) => (
                        <TextField {...params} label="Search Brands" />
                      )}
                    />
                  </Grid>
                </Grid>
                <Grid container spacing={2} sx={{ marginTop: "10px" }}>
                  <Grid item xs={6}>
                    <FormControl fullWidth sx={{ m: 1 }} variant="outlined">
                      <InputLabel htmlFor="standard-adornment-amount">
                        Purchase Price
                      </InputLabel>
                      <Input
                        id="standard-adornment-amount"
                        startAdornment={
                          <InputAdornment position="start">$</InputAdornment>
                        }
                      />
                    </FormControl>
                  </Grid>
                  <Grid item xs={6}>
                    <FormControl fullWidth sx={{ m: 1 }} variant="outlined">
                      <InputLabel htmlFor="standard-adornment-amount">
                        Price
                      </InputLabel>
                      <Input
                        id="standard-adornment-amount"
                        startAdornment={
                          <InputAdornment position="start">$</InputAdornment>
                        }
                      />
                    </FormControl>
                  </Grid>
                </Grid>
                <Grid container spacing={2} sx={{ marginTop: "10px" }}>
                  <Grid item xs={6}>
                    <TextareaAutosize
                      aria-label="empty textarea"
                      placeholder="Descrpition"
                      style={{ width: "100%" }}
                    />
                  </Grid>
                  <Grid item xs={6}>
                    <Autocomplete
                      onChange={(event, newValue) => {
                        setBrandId(newValue === null ? 0 : newValue.id);
                      }}
                      // inputValue={inputValue}
                      // onInputChange={(event, newInputValue) => {
                      //   setInputValue(newInputValue);
                      // }}
                      id="controllable-states-demo"
                      getOptionLabel={(brands) =>
                        `${brands.brand} ${brands.id}`
                      }
                      options={brand}
                      sx={{ width: "100%", background: "#fff" }}
                      isOptionEqualToValue={(option, value) =>
                        option.brand === value.brand
                      }
                      noOptionsText={"NO STATUS"}
                      renderOption={(props, brands) => (
                        <Box component="li" {...props} key={brands.id}>
                          {brands.brand} {brands.id}
                        </Box>
                      )}
                      renderInput={(params) => (
                        <TextField {...params} label="Status" />
                      )}
                    />
                  </Grid>
                </Grid>
                <Grid container spacing={2} sx={{ marginTop: "10px" }}>
                  <Grid item xs={6}>
                    <Button variant="outlined">Add Product</Button>
                  </Grid>
                </Grid>
              </Box>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
export default AddProduct;
